import React from 'react'
import './Navbar.scss'

import { images } from '../../constanst'

const Navbar = () => {
  return (
    <nav>
      <div>
        <img src={ images.logo } alt='logo' />
      </div>
      <ul>
        {['home', 'about','contact', 'work', 'skills', 'contact'].map((item, index) => (
          <li key={index}></li>
        ))}
      </ul>
    </nav>
  )
}

export default Navbar
